import axios from "axios";

const Home = () => {
    const [users, setUser] = useState([]);

    useEffect(() => {
    loadUsers();
    }, []);

    const loadUsers = async () => {
        const result = await axios.get("http://localhost:3005/users");
        setUser(result.data);
    };


    return (
        <div className='container'>
            <div className='py-4'>
                <h1>Home Page</h1>
                <table class="table">
  <thead class="thead-dark">
    <tr>
      <th scope="col">#</th>
      <th scope="col">First</th>
      <th scope="col">Last</th>
      <th scope="col">Handle</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <th scope="row">1</th>
      <td>Mark</td>
      <td>Otto</td>
      <td>@mdo</td>
    </tr>
    <tr>
      <th scope="row">2</th>
      <td>Jacob</td>
      <td>Thornton</td>
      <td>@fat</td>
    </tr>
    <tr>
      <th scope="row">3</th>
      <td>Larry</td>
      <td>the Bird</td>
      <td>@twitter</td>
    </tr>
  </tbody>
</table>
            </div>
        </div>
    );
};

export default Home;
